INSERT INTO `deliverable` (`deliverable_id`, `course_name`, `course_section`, `deliverable_title`, `deliverable_description`, `deliverable_duedate`) VALUES
(1, 'CS126L', 'BM1', 'Programming Activity 1', 'The code int rand (void); is the line to use to generate a random number. It returns a pseudo-random integral number in the range between 0 and RAND_MAX. This number is generated by an algorithm that returns a sequence of apparently non-related numbers each time it is called. This algorithm uses a seed to generate the series, which should be initialized to some distinctive value using function srand. Create a C++ program that will generate 10 random integers between 1-10 (repeatable).', '01 May 2022 - 11:59 PM'),
(2, 'CS126L', 'BM2', 'Programming Activity 1', 'The code int rand (void); is the line to use to generate a random number. It returns a pseudo-random integral number in the range between 0 and RAND_MAX. This number is generated by an algorithm that returns a sequence of apparently non-related numbers each time it is called. This algorithm uses a seed to generate the series, which should be initialized to some distinctive value using function srand. Create a C++ program that will generate 10 random integers between 1-10 (repeatable).', '01 May 2022 - 11:59 PM'),
(3, 'IT145L', 'BM1', 'Assessment No. 1', 'Following instructions is an important ability to practice in everyday life. Within an academic setting, following instructions can influence grades, learning subject matter, and correctly executing skills. Upload a .txt file containing your name in this format: Last Name, First Name, Middle Initial', '25 April 2022 - 12:00 PM'),
(4, 'IT145L', 'BM2', 'Assessment No. 1', 'Following instructions is an important ability to practice in everyday life. Within an academic setting, following instructions can influence grades, learning subject matter, and correctly executing skills. Upload a .txt file containing your name in this format: Last Name, First Name, Middle Initial', '25 April 2022 - 12:00 PM'),
(5, 'GED145', 'BM1', 'Reading Activity 1', 'When you read, you exercise your comprehension abilities and your analytical abilities. It fires up your imagination and stimulates the memory centers of your mind. It helps recall information as well as stabilize your emotions. The importance of a reading habit is that it strengthens mental muscles. Just read the first chapter of the assigned book for this class, and upload a .txt file containing your 5-sentence summary.', '20 April 2022 - 11:59 PM'),
(6, 'GED145', 'BM2', 'Reading Activity 1', 'When you read, you exercise your comprehension abilities and your analytical abilities. It fires up your imagination and stimulates the memory centers of your mind. It helps recall information as well as stabilize your emotions. The importance of a reading habit is that it strengthens mental muscles. Just read the first chapter of the assigned book for this class, and upload a .txt file containing your 5-sentence summary.', '20 April 2022 - 11:59 PM'),
(7, 'CS126L', 'BM1', 'Homework 1.1: String Input and Output', 'In C++, cout sends formatted output to standard output devices, such as the screen. We use the cout object along with the << operator for displaying output. In C++, cin takes formatted input from standard input devices such as the keyboard. We use the cin object along with the >> operator for taking input. Create a C++ program that allows the user to input a string type of text and after, outputs the entered string.', '29 April 2022 - 12:30 PM'),
(8, 'GED120', 'BM1', 'Short Essay Part 1', 'Essay writing is an important part of studying for it increases understanding and helps the process of learning (to clarify and sort out ideas and information, to analyze source material and to exercise critical judgement). Write an essay about your childhood experiences and how such shaped you to be the man or the woman that you are today. Minimum words of 1000. Text should be justified, using TNR size 12.', '13 May 2022 - 7:00 AM'),
(9, 'GED120', 'BM2', 'Short Essay Part 1', 'Essay writing is an important part of studying for it increases understanding and helps the process of learning (to clarify and sort out ideas and information, to analyze source material and to exercise critical judgement). Write an essay about your childhood experiences and how such shaped you to be the man or the woman that you are today. Minimum words of 1000. Text should be justified, using TNR size 12.', '13 May 2022 - 7:00 AM'),
(10, 'CS145', 'BM1', 'Short Research', 'Computer Science is the study of computers and computational systems. Unlike electrical and computer engineers, computer scientists deal mostly with software and software systems; this includes their theory, design, development, and application. Research about the history of Computer Science. Minimum of 5 pages. Make sure to include citations. Add some images as well for reference.', '28 April 2022 - 8:00 AM'),
(11, 'CS145', 'BM2', 'Short Research', 'Computer Science is the study of computers and computational systems. Unlike electrical and computer engineers, computer scientists deal mostly with software and software systems; this includes their theory, design, development, and application. Research about the history of Computer Science. Minimum of 5 pages. Make sure to include citations. Add some images as well for reference.', '28 April 2022 - 8:00 AM'),
(12, 'IT180L', 'BM1', 'Assignment 1.1', 'Network Technology involves the use of data systems to manage and deliver digital resources over a computer network. A variety of industries use computer hardware and system software that maintains a network, creating a need for specialists to manage them. Define what networking technologies are, and provide examples. Put it in a Microsoft PowerPoint presentation and send the PDF version.', '13 May 2022 - 7:30 AM'),
(13, 'IT180L', 'BM2', 'Assignment 1.1', 'Network Technology involves the use of data systems to manage and deliver digital resources over a computer network. A variety of industries use computer hardware and system software that maintains a network, creating a need for specialists to manage them. Define what networking technologies are, and provide examples. Put it in a Microsoft PowerPoint presentation and send the PDF version.', '13 May 2022 - 7:30 AM'),
(14, 'CS126L', 'BM2', 'Homework 1.1: String Input and Output', 'In C++, cout sends formatted output to standard output devices, such as the screen. We use the cout object along with the << operator for displaying output. In C++, cin takes formatted input from standard input devices such as the keyboard. We use the cin object along with the >> operator for taking input. Create a C++ program that allows the user to input a string type of text and after, outputs the entered string.', '25 April 2022 - 7:00 AM'),
(16, 'CS145', 'BM1', 'Extra Credit', 'Since most of the class got relative poor grades, I am willing to give you a chance to pull your grades up. Look up the most primitive computer, identify its architecture, and explain your realizations. Submit in PDF.', '25 April 2022 - 11:30 AM'),
(18, 'IT145L', 'BM1', 'Assessment No. 2', 'For your second assessment, kindly turn in a 2-page essay (TNR, size 12, justified) all about someone who is working in the field of Information Technology. You could interview someone you may know, or simply look up a person on the Internet. Submit in PDF form.', '05 May 2022 - 11:59 PM'),
(20, 'CS126L', 'BM1', 'Homework 1.2: String Input and Output', 'In C++, cout sends formatted output to standard output devices, such as the screen. We use the cout object along with the << operator for displaying output. In C++, cin takes formatted input from standard input devices such as the keyboard. We use the cin object along with the >> operator for taking input. Create a C++ program that allows the user to input a string type of text and after, outputs the entered string.', '29 April 2022 - 12:30 PM');

